import styled from 'styled-components'

export const Container = styled.div`
    display: flex;
    align-itens: center;
    justify-content: center;
    width: 100%;
    height: 100vh;
    background: linear-gradient(to bottom right, #3C9DD0, #0A3D62);
`;

export const Imagem = styled.img`
    width: 50%;

`
